import React, { Component, Fragment} from 'react';
import './UserProfileStyles.css';
import instance from '../../services/tokenprovider';

export class UserProfile extends Component {
    constructor(props){
        super(props);
        this.state = {
            currentUser:[]
        }
    }

    componentDidMount(){
        instance.get('showalltodos')
        .then(responce => {
            const currentUser = responce.data;
            this.setState({
                currentUser
            })
        })
    }
    render() {
        return (
        <Fragment>
            <div className='container'>
                <div className='row justify-content-md-center' id='mainInfo'>
                    {this.state.currentUser.map(currentUser => {
                        <p></p>
                    })}
                    <div className='col-xs-12 col-lg-3 ' id='profilePicture'>
                        <div id='avatar'>
                            {/* <input type ="file" /> */}
                        </div>
                    </div>
                    <div className='col-xs-12 col-lg-3 ' id='profileDescription' >
                        <p id='userName'> user name</p>
                        <span className='userNick'>@</span><span className='userNick'> usernick </span>
                    </div>
                </div>
            </div>
        </Fragment>
        )
    }
}

export default UserProfile;
